import React from 'react'

const Table = (list) => {
  return (
    <div>
        { list.length > 0 ? (
        <>
        { list.map( (item) => (
          <div key={item.retail_id}> 
          <p>{item.email}</p>
          <a href={'http://localhost:8000'+item.image} target="_blank" rel="noopener noreferrer">image link</a>
          </div>
        ) ) }
        </>
      ) : ('NO DATA TO DISPLAY') }
    </div>
  )
}

export default Table
